r($,"aJG","akz",()=>A.a([A.qH("During my internship at Advanced Product Design Sdn Bhd, I had the opportunity to work on an exciting project that involved the development of a full-stack Android chat application. My role in this project was to design and implement the chat application's front-end and back-end functionalities. The chat app was designed to facilitate seamless communication between users, allowing them to chat, meet and call each other through a user-friendly and intuitive interface. To ensure efficient and secure data storage and transfer, we utilized both local and server databases, including SMACK, XMPP, Ejabberd, MYSQL workbench, and SQLITE. This approach enabled us to leverage the benefits of both local and remote data storage systems, thus providing users with a robust and reliable chat platform. To develop this app, I utilized my proficiency in Java programming language to implement the various features and functionalities that the app required. By leveraging the versatility and power of Java, I was able to develop a robust and flexible chat application that met the client's requirements and exceeded their expectations. Overall, this project was a challenging and rewarding experience that allowed me to sharpen my skills in full-stack development, database management, and programming. It was an excellent opportunity to learn and apply cutting-edge technologies in developing an innovative chat application that met the needs of modern-day communication.","assets/images/AndroidChatApp.webp","VidCall Chat Android Mobile Application"),A.qH("Introducing MentorConnect, an Android mobile application that redefines the learning experience through advanced technologies like Kotlin, Firebase, Flutter, and Dart. This platform facilitates effortless teaching sessions, allowing users to seamlessly share knowledge within a user-friendly interface. The application's key feature lies in its comprehensive mentor search functionality, enabling users to connect with mentors possessing the specific expertise they seek. Real-time communication further enhances the learning process, fostering immediate interaction, idea exchange, and valuable feedback. Built on a secure and reliable technology stack, MentorConnect prioritizes user data security while delivering a smooth and dependable user experience. Users can personalize their learning paths, set goals, and receive guidance from mentors who understand their unique educational journey. The application includes a robust feedback and rating system to ensure transparency and accountability, creating a community of dedicated mentors and enthusiastic learners. MentorConnect goes beyond individual connections, offering a supportive community where users can engage in forums, expand their network, and collectively contribute to a culture of continuous learning and growth.","assets/images/MentorConnectApp.webp","MentorConnect Android Mobile Application"),A.qH("Introducing ToDoApplication, a sophisticated task management solution designed to elevate your productivity. Developed using Flutter and Dart, this application seamlessly integrates with Firebase to provide users with a seamless and efficient way to organize their daily tasks. With an intuitive interface, ToDoApplication allows users to effortlessly list down their to-dos, streamlining the task organization process. The real-time synchronization enabled by Firebase ensures that your to-do lists are always up-to-date across devices, keeping you informed and in control no matter where you are. One of the standout features of ToDoApplication is its straightforward task completion tracking system. Users can easily mark tasks as completed, allowing for a clear and tangible way to monitor and celebrate progress. Built with a focus on user experience, the application boasts a clean, modern design that prioritizes simplicity and functionality. Powered by the robust combination of Flutter, Dart, and Firebase, ToDoApplication delivers a visually appealing and performant solution for efficient task management. Whether you're a professional striving for productivity or a student managing assignments, ToDoApplication is your go-to companion.","assets/images/ToDoApp.webp","ToDo Application"),A.qH("During my degree level 2, I was tasked with an important programming module that required me to develop a hotel management booking application using Java programming language in Netbean IDE. This project was particularly challenging, as it demanded a high level of technical proficiency and attention to detail to ensure that the application was not only efficient, but also user-friendly. Throughout the development process, I employed various Java concepts and techniques to create a robust and reliable application that met the requirements of the project. I utilized object-oriented programming principles to create reusable code that could be easily adapted and modified, as well as incorporated graphical user interface (GUI) elements to make the application more visually appealing and interactive. To ensure the smooth operation of the hotel management booking application, I implemented a range of features, such as reservation management, customer check-in and check-out procedures, room availability tracking, and billing and payment processing. In addition, I utilized various Java libraries and frameworks, including Apache Maven and Hibernate, to enhance the functionality of the application and make it more versatile.Overall, my experience developing the hotel management booking application using Java programming language was both challenging and rewarding. It allowed me to expand my technical skills, while also providing me with valuable insights into the importance of effective project management, problem-solving, and collaboration.","assets/images/HotelManagementBooking.webp","Hotel Management Booking Desktop Software"),A.qH("As a skilled web developer, I have successfully created an innovative and user-friendly e-learning web application using various programming languages and tools, including Bootstrap, HTML, CSS, PHP, MySQL, and JavaScript. This comprehensive platform facilitates online learning by allowing users to access various courses, including publishing their courses online. The application is designed with the user's needs in mind, incorporating a modern and responsive layout that caters to a diverse range of learners. With its intuitive interface and robust features, users can seamlessly navigate through the site and access the vast array of courses on offer. In addition, the platform is built with the latest technologies, ensuring that it runs smoothly and efficiently, providing users with an optimal learning experience. The integration of PHP and MySQL enables the seamless storage and retrieval of user data, ensuring that the application can handle large volumes of user data. Moreover, the application is designed with a flexible and scalable architecture, making it easy to customize and expand based on user feedback and evolving industry requirements. The implementation of JavaScript programming language further enhances the user experience, providing dynamic features that add to the interactivity of the platform. In summary, my e-learning web application is a remarkable and innovative platform that leverages the latest programming languages and technologies to provide users with a comprehensive online learning experience. Its intuitive interface, robust features, and scalable architecture make it an excellent tool for online learners and content creators alike.","assets/images/E-learning.webp","E-learning Website"),A.qH("I have designed and developed an innovative online e-library web application utilizing various cutting-edge programming languages such as Bootstrap, HTML, CSS, PHP, MySQL, and JavaScript. This platform facilitates users to browse and access a wide range of educational resources, including online courses and educational materials, from anywhere at any time. As a dynamic e-learning platform, it incorporates a broad spectrum of features, such as interactive forums, quizzes, assignments, and assessments, to foster an engaging and collaborative learning environment. The user-friendly interface and intuitive design of the web application make it simple for users to navigate through different categories of courses and materials, allowing them to tailor their learning experience to suit their individual preferences. Moreover, my online e-library web application also empowers users to publish their own courses and materials, promoting knowledge sharing and community engagement. It provides a platform for experts, educators, and learners to connect and share their knowledge and experiences, thereby promoting a culture of continuous learning and development. Overall, this online e-library web application represents a significant step towards democratizing access to quality education and promoting lifelong learning. It is a valuable asset for students, educators, and professionals seeking to enhance their skills and knowledge in a flexible and accessible manner.","assets/images/E-library.webp","E-library Website"),A.qH("The CoronAI Chatbot is a sophisticated conversational agent developed using Chatfuel, aimed at providing timely and accurate information related to COVID-19, along with its diagnosis. The chatbot is designed to provide the best user experience to its users while navigating through the information landscape related to COVID-19. With the advent of the COVID-19 pandemic, there has been a significant increase in the need for easily accessible and reliable information related to the disease. The CoronAI Chatbot addresses this need by providing an efficient and personalized user experience that is tailored to meet the specific information requirements of each user. Using natural language processing techniques, the chatbot can understand and respond to user queries in real-time. It provides information on the latest COVID-19 statistics, preventive measures, and treatment options. Additionally, the chatbot is equipped with a robust diagnostic feature that helps users to self-assess their symptoms and determine whether they need to seek medical attention. The chatbot's user interface is designed to be user-friendly and intuitive, with simple navigation menus and easy-to-understand prompts. It is accessible 24/7 and can be accessed from a range of devices, including smartphones, tablets, and desktop computers. Overall, the CoronAI Chatbot is an innovative tool that provides a one-stop-shop for all COVID-19 related information and diagnosis. Its sophisticated design and intuitive interface provide a seamless user experience, making it an invaluable resource for individuals, healthcare professionals, and policymakers alike.","assets/images/ChatBot.webp","ChatBot")],A.X("r<Ih>")))
